INSERT OR IGNORE INTO Note VALUES('d27a197e','Basic Koala Facts','Koalas are found in the eucalyptus forests of eastern Australia. They have grey fur with a cream-coloured chest, and strong, clawed feet, perfect for living in the branches of trees!',CURRENT_TIMESTAMP,CURRENT_TIMESTAMP,'cmjj43j0c001z87g33jd5ux34');
INSERT OR IGNORE INTO Note VALUES('414f0c09','Koalas like to cuddle','Cuddly critters, koalas measure about 60cm to 85cm long, and weigh about 14kg.',CURRENT_TIMESTAMP,CURRENT_TIMESTAMP,'cmjj43j0c001z87g33jd5ux34');
INSERT OR IGNORE INTO Note VALUES('260366b1','Not bears','Although you may have heard people call them koala ''bears'', these awesome animals aren''t bears at all – they are in fact marsupials. A group of mammals, most marsupials have pouches where their newborns develop.',CURRENT_TIMESTAMP,CURRENT_TIMESTAMP,'cmjj43j0c001z87g33jd5ux34');
INSERT OR IGNORE INTO Note VALUES('bb79cf45','Snowboarding Adventure','Today was an epic day on the slopes! Shredded fresh powder with my friends, caught some sick air, and even attempted a backflip. Can''t wait for the next snowy adventure!',CURRENT_TIMESTAMP,CURRENT_TIMESTAMP,'cmjj43j0c001z87g33jd5ux34');
INSERT OR IGNORE INTO Note VALUES('9f4308be','Onewheel Tricks','Mastered a new trick on my Onewheel today called ''180 Spin''. It''s exhilarating to carve through the streets while pulling off these rad moves. Time to level up and learn more!',CURRENT_TIMESTAMP,CURRENT_TIMESTAMP,'cmjj43j0c001z87g33jd5ux34');
INSERT OR IGNORE INTO Note VALUES('306021fb','Coding Dilemma','Stuck on a bug in my latest coding project. Need to figure out why my function isn''t returning the expected output. Time to dig deep, debug, and conquer this challenge!',CURRENT_TIMESTAMP,CURRENT_TIMESTAMP,'cmjj43j0c001z87g33jd5ux34');
INSERT OR IGNORE INTO Note VALUES('16d4912a','Coding Mentorship','Had a fantastic coding mentoring session today with Sarah. Helped her understand the concept of recursion, and she made great progress. It''s incredibly fulfilling to help others improve their coding skills.',CURRENT_TIMESTAMP,CURRENT_TIMESTAMP,'cmjj43j0c001z87g33jd5ux34');
INSERT OR IGNORE INTO Note VALUES('3199199e','Koala Fun Facts','Did you know that koalas sleep for up to 20 hours a day? It''s because their diet of eucalyptus leaves doesn''t provide much energy. But when I''m awake, I enjoy munching on leaves, chilling in trees, and being the cuddliest koala around!',CURRENT_TIMESTAMP,CURRENT_TIMESTAMP,'cmjj43j0c001z87g33jd5ux34');
INSERT OR IGNORE INTO Note VALUES('2030ffd3','Skiing Adventure','Spent the day hitting the slopes on my skis. The fresh powder made for some incredible runs and breathtaking views. Skiing down the mountain at top speed is an adrenaline rush like no other!',CURRENT_TIMESTAMP,CURRENT_TIMESTAMP,'cmjj43j0c001z87g33jd5ux34');
INSERT OR IGNORE INTO Note VALUES('f375a804','Code Jam Success','Participated in a coding competition today and secured the first place! The adrenaline, the challenging problems, and the satisfaction of finding optimal solutions—it was an amazing experience. Feeling proud and motivated to keep pushing my coding skills further!',CURRENT_TIMESTAMP,CURRENT_TIMESTAMP,'cmjj43j0c001z87g33jd5ux34');
INSERT OR IGNORE INTO Note VALUES('562c541b','Koala Conservation Efforts','Joined a local conservation group to protect koalas and their habitats. Together, we''re planting more eucalyptus trees, raising awareness about their endangered status, and working towards a sustainable future for these adorable creatures. Every small step counts!',CURRENT_TIMESTAMP,CURRENT_TIMESTAMP,'cmjj43j0c001z87g33jd5ux34');
INSERT OR IGNORE INTO Note VALUES('f67ca40b','Game day',replace('Just got back from the most amazing game. I''ve been playing soccer for a long time, but I''ve not once scored a goal. Well, today all that changed! I finally scored my first ever goal.\n\nI''m in an indoor league, and my team''s not the best, but we''re pretty good and I have fun, that''s all that really matters. Anyway, I found myself at the other end of the field with the ball. It was just me and the goalie. I normally just kick the ball and hope it goes in, but the ball was already rolling toward the goal. The goalie was about to get the ball, so I had to charge. I managed to get possession of the ball just before the goalie got it. I brought it around the goalie and had a perfect shot. I screamed so loud in excitement. After all these years playing, I finally scored a goal!\n\nI know it''s not a lot for most folks, but it meant a lot to me. We did end up winning the game by one. It makes me feel great that I had a part to play in that.\n\nIn this team, I''m the captain. I''m constantly cheering my team on. Even after getting injured, I continued to come and watch from the side-lines. I enjoy yelling (encouragingly) at my team mates and helping them be the best they can. I''m definitely not the best player by a long stretch. But I really enjoy the game. It''s a great way to get exercise and have good social interactions once a week.\n\nThat said, it can be hard to keep people coming and paying dues and stuff. If people don''t show up it can be really hard to find subs. I have a list of people I can text, but sometimes I can''t find anyone.\n\nBut yeah, today was awesome. I felt like more than just a player that gets in the way of the opposition, but an actual asset to the team. Really great feeling.\n\nAnyway, I''m rambling at this point and really this is just so we can have a note that''s pretty long to test things out. I think it''s long enough now... Cheers!','\n',char(10)),CURRENT_TIMESTAMP,CURRENT_TIMESTAMP,'cmjj43j0c001z87g33jd5ux34');

